from typing import List

class Solution:
    def countSquares(self, matrix: List[List[int]]) -> int:
        m = len(matrix)
        n = len(matrix[0])
        # print(m, n)
        result = 0
        dp = [[0] * n for i in range(m)]
        left = [[0] * n for i in range(m)]
        top = [[0] * n for i in range(m)]
        for i in range(m):
            for j in range(n):
                if matrix[i][j] == 0:
                    continue
                result += 1
                dp[i][j] = 1
                if i == 0:
                    top[i][j] = 1
                else:
                    top[i][j] = top[i - 1][j] + 1
                if j == 0:
                    left[i][j] = 1
                else:
                    left[i][j] = left[i][j - 1] + 1
                if i > 0 and j > 0:
                    if dp[i - 1][j - 1] > 0:
                        size = min(top[i][j], left[i][j], dp[i - 1][j - 1] + 1)
                        result += size - 1
                        dp[i][j] = size
        # print(dp, left, top)
        return result

